const Header =()=>{
return(
    <>
    <div className="header">
        <ul>
            <li><a>Home</a></li>
            <li><a>Home</a></li>
            <li><a>Home</a></li>
            <li><a>Home</a></li>
            <li><a>Home</a></li>
            <li><a>Home</a></li>
        </ul>
    </div>
    
    </>
    );
};
export default Header;
